import React from 'react';
import { Link } from 'react-router-dom'; 

function App() {
  return (
    <div>
      <nav>
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/products">Products</Link></li>
          <li><Link to="/contact-us">Contact Us</Link></li>
        </ul>
      </nav>
      {/* Routes and other components */}
    </div>
  );
}

export default App;
